import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatButtonModule } from '@angular/material/button';
import { MatToolbarModule } from '@angular/material/toolbar';
import { MatMenuModule } from '@angular/material/menu';
import { RouterLink } from '@angular/router';

@Component({
  selector: 'app-header',
  standalone: true,
  imports: [CommonModule, MatToolbarModule, MatMenuModule, MatButtonModule, RouterLink],
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent {

}
<mat-toolbar color="primary">
    <span>Angular Basic</span>
    <button mat-button routerLink="/home">Home</button>
    <button mat-button routerLink="/grocery">Grocery</button>
    <button mat-button routerLink="/sports">Sports</button>
</mat-toolbar>
